define({"topics" : [{"title":"Mapping controls to unmatched elements","shortdesc":"\n                     <p class=\"shortdesc\">Interface elements identify controls in an application window. It is possible, often as     a result of an application change,\n                        for an interface element to lose its mapping to its     associated control. We call this an \"unmatched\" element, and the cause\n                        is generally a change in     one or more property values of the control. When this occurs, you must remap the control to the\n                        unmatched element. \n                     </p>\n                  ","id":"Interface_viewer_maintaning_mapping_controls","href":"TA_Help\/Topics\/Interface_def_Viewer_maintaining_mapping_controls.html","menu": {"hasChildren":false,},"tocID":"Interface_viewer_maintaning_mapping_controls-d46e22808","topics":[]}]});